function moveResponseTimeGraph(percentage)
{var range=responseTimeGraph.getWindow();var interval=range.end-range.start;responseTimeGraph.setWindow({start:range.start.valueOf()-interval*percentage,end:range.end.valueOf()-interval*percentage});}
function zoomResponseTimeGraph(percentage)
{var range=responseTimeGraph.getWindow();var interval=range.end-range.start;responseTimeGraph.setWindow({start:range.start.valueOf()-interval*percentage,end:range.end.valueOf()+interval*percentage});}
document.getElementById('zoomInResponseTimeGraph').onclick=function(){zoomResponseTimeGraph(-0.2);};document.getElementById('zoomOutResponseTimeGraph').onclick=function(){zoomResponseTimeGraph(0.2);};document.getElementById('moveLeftResponseTimeGraph').onclick=function(){moveResponseTimeGraph(0.2);};document.getElementById('moveRightResponseTimeGraph').onclick=function(){moveResponseTimeGraph(-0.2);};